  \"2013-03-25T23:32:31.839987\",\n\t\"name\": \"national-wetlands-inventory-polygonsbac4e\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This data set represents the extent, approximate
  location and type of wetlands and deepwater habitats in the conterminous United
  States. These data delineate the areal extent of wetlands and surface waters as
  defined by Cowardin et al. (1979). Certain wetland habitats are excluded from the
  National mapping program because of the limitations of aerial imagery as the primary
  data source used to detect wetlands. These habitats include seagrasses or submerged
  aquatic vegetation that are found in the intertidal and subtidal zones of estuaries
  and near shore coastal waters. Some deepwater reef communities (coral or tuberficid
  worm reefs) have also been excluded from the inventory. These habitats, because
  of their depth, go undetected by aerial imagery. By policy, the Service also excludes
  certain types of \"farmed wetlands\" as may be defined by the Food Security Act
  or that do not coincide with the Cowardin et al. definition. Contact the Service's
  Regional Wetland Coordinator for additional information on what types of farmed
  wetlands are included on wetland maps.\",\n\t\"license_title\": null,\n\t\"extras\":
